function Unicoder(){var characterOrders={lowercase:"abcdefghijklmnopqrstuvwxyz",uppercase:"ABCDEFGHIJKLMNOPQRSTUVWXYZ"};var unicodePrefix="&#x";var unicodeSuffix=";";var dictionary={circled:{generate:{uppercase:9398,lowercase:9424}},"negative-circled":{generate:{uppercase:127312}},squared:{generate:{uppercase:127280}},"negative-squared":{generate:{uppercase:127344}},script:{generate:{uppercase:120016,lowercase:120042}},fraktur:{generate:{uppercase:120172,lowercase:120198}},parenthesized:{generate:{lowercase:9372}},monospace:{generate:{uppercase:120432,lowercase:120458}}};function generateDictionary(){var keys=Object.keys(dictionary);var i=0;for(i;i<keys.length;i++){var key=keys[i];var item=dictionary[key];if(item.generate){if(item.generate.lowercase){for(var j=0;j<characterOrders.lowercase.length;j++){dictionary[key][characterOrders.lowercase[j]]=unicodePrefix+(item.generate.lowercase+j).toString(16)+unicodeSuffix}}if(item.generate.uppercase){for(var j=0;j<characterOrders.uppercase.length;j++){dictionary[key][characterOrders.uppercase[j]]=unicodePrefix+(item.generate.uppercase+j).toString(16)+unicodeSuffix}}if(!item.generate.lowercase){for(var j=0;j<characterOrders.lowercase.length;j++){dictionary[key][characterOrders.lowercase[j]]=unicodePrefix+(item.generate.uppercase+j).toString(16)+unicodeSuffix}}if(!item.generate.uppercase){for(var j=0;j<characterOrders.uppercase.length;j++){dictionary[key][characterOrders.uppercase[j]]=unicodePrefix+(item.generate.lowercase+j).toString(16)+unicodeSuffix}}delete dictionary[key]["generate"]}}}function translate(text,type){return bruteForceTranslate(text,dictionary[type])}function getDictionaryKeys(){return Object.keys(dictionary)}function bruteForceTranslate(text,dictionary){var hasCapitals=dictionary["A"]!==undefined;var hasLower=dictionary["a"]!==undefined;var i=0;var letters=text.split("");for(i;i<letters.length;i++){var letter=letters[i];if(letter in dictionary){letters[i]=dictionary[letter]}}return letters.join("")}generateDictionary();return{translate:translate,getDictionaryKeys:getDictionaryKeys}}